import React, { Component } from "react";
import { Link } from "react-router-dom";
import Accordion from 'react-bootstrap/Accordion';

class LeftMenuContent extends Component {

  render() {
    const { document } = this.props;

    return (
      <div className="col-3 collapse show d-md-flex bg-light min-vh-100 border border-left-0"  >
      <ul className="nav flex-column flex-nowrap overflow-hidden">
      
        <li className="nav-item">
          <Link to={`/dashboard/${document.documentId}`} className="nav-link collapsed text-truncate"
            to="/"
            data-toggle="collapse"
            data-target="#submenu1"
          >
            <span className="d-none d-sm-inline side-nav-title">
              {document.subject}
            </span>
          </Link>
          <div class="collapse" id="submenu1" aria-expanded="false">
            <ul class="flex-column pl-2 nav">
              <li class="nav-item">
                <Link class="active nav-link py-0" to="/createDocument">
                  <span class="side-nav-title topics">
                    {document.topic}
                  </span>
                </Link>
              </li>
              <li class="nav-item">
                <a class="nav-link py-0" href="/listDocument">
                  <span class="side-nav-title topics">
                    {document.subTopic}
                  </span>
                </a>
              </li>
            </ul>
          </div>
        </li>
      </ul>
    </div>
    );
  }
}

export default LeftMenuContent;
